import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import React from 'react';
import {Home} from './componenets/Home';

function App() {
  return (
    <Router>
      <div>
        <p>this is p</p>
        <Routes>
          <Route exact path="/" component={Home} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
